let videoFrameRate = 59.94;
let curTime = 0;
let looped = true;//false;
let lastFrameNum = 0;
let isSetup = false;

function preload() {
  video = createVideo('assets/clip3.mp4', () => {
    console.log("ready")
    setupPromise();
  });
  sh = loadShader('vert.glsl', 'frag.glsl');
  envImage = loadImage('assets/env.jpg');
}

function setup() {
  noLoop();
}

function onPose(results) {
  if (looped) return;
  poses = results;
  drawKeypoints();
}

function setupPromise() {
  if (isSetup) return;
  isSetup = true;
  let aspectRatio = video.width / video.height;
  if(aspectRatio > 1.0) {
    createCanvas(720, 720 / aspectRatio, WEBGL);
  }
  else {
    createCanvas(720 * aspectRatio, 720, WEBGL);
  }
  pixelDensity(2.0);

  video.loop();
  video.volume(0);
  video.play();
  video.size(width, height);
  if (false) {
    // Create a new poseNet method with a single detection
    poseNet = ml5.poseNet(video, modelReady);
    // This sets up an event that fills the global variable "poses"
    // with an array every time new poses are detected
    poseNet.on('pose', onPose);
    video.speed(0.5);
  }
  else {
    loop();
    video.speed(1.0);
  }
  // Hide the video element, and just show the canvas
  video.hide();
}

function modelReady() {
  // select('#status').html('Model Loaded');
  loop();
}

function draw() {
  background(0);
  translate(-width / 2, -height / 2);

  colorMode(RGB, 255);

  sh.setUniform('uBrighter', 0.0);

  texture(video);
  beginShape();
  vertex(0, 0, 0, 0, 0);
  vertex(width, 0, 0, 1, 0);
  vertex(width, height, 0, 1, 1);
  vertex(0, height, 0, 0, 1);
  endShape(CLOSE);

  ambientLight(200, 200, 200);
  let lc = 150;
  directionalLight(lc, lc, lc, 0.25, 0.25, -0.5);
  directionalLight(lc, lc, lc, -0.25, 0.25, -0.5);

  colorMode(HSB, 255);
  shader(sh);
  sh.setUniform('uSampler', video);
  sh.setUniform('uBrighter', 1.0);
  // We can call both functions to draw all keypoints and the skeletons
  drawAvatars();

  // drawSkeleton();
}

// A function to draw ellipses over the detected keypoints
function drawKeypoints() {
  let frame = [];
  // Loop through all the poses detected
  for (let i = 0; i < poses.length; i++) {
    let avatar = [];
    // get size
    let tall = 0;
    {
      let hmax = 0;
      let hmin = 1000;
      let skeleton = poses[i].skeleton;
      // For every skeleton, loop through all body connections
      for (let j = 0; j < skeleton.length; j++) {
        let partA = skeleton[j][0];
        let partB = skeleton[j][1];
        stroke(255, 0, 0);
        line(partA.position.x, partA.position.y, partB.position.x, partB.position.y);
        hmin = Math.min(hmin, partA.position.y);
        hmin = Math.min(hmin, partB.position.y);
        hmax = Math.max(hmax, partA.position.y);
        hmax = Math.max(hmax, partB.position.y);
      }
      if(skeleton.length) {
        tall = hmax - hmin;
      }
      else {
        continue;
      }
    }

    // For each pose detected, loop through all the keypoints
    let pose = poses[i].pose;
    for (let j = 0; j < pose.keypoints.length; j++) {
      // A keypoint is an object describing a body part (like rightArm or leftShoulder)
      let keypoint = pose.keypoints[j];
      // Only draw an ellipse is the pose probability is bigger than 0.2
      if (keypoint.score > 0.2) {
      }

      if(j < 5) {
        let dw = 25;
        let dh = tall * 0.1;
        if(dh < 10) dh = 10;
        avatar.push({
          x: keypoint.position.x,
          y: keypoint.position.y,
          r: dh,
          c: 255 * i / 10.0
        });
      }
    }
    frame.push(avatar);
  }
  let curFrameNum = parseInt(video.time() * videoFrameRate);
  if(curFrameNum < lastFrameNum) {
    console.log("looped")
    looped = true;
    video.speed(1.0);
    console.log(JSON.stringify(frameNums))
    console.log(JSON.stringify(avatars))
    // poseNet.off('pose', onPose);
  }
  else {
    avatars.push(frame);
    frameNums.push(curFrameNum);
    lastFrameNum = curFrameNum;
  }
}

function drawAvatars()  {
  let index = parseInt(video.time() * videoFrameRate) + 0;
  for(let i = 0; i < frameNums.length; i++) {
    let frame;
    if(index - 60 > frameNums[i]) {
      continue;
    }
    if(index <= frameNums[i]) {
      continue;
    }
    frame = avatars[i];

    if(frame == undefined || frame.length == undefined) continue;
    for (let avatar of frame) {
      for (let point of avatar) {
        push();
        noStroke();
        let sat = map(index, frameNums[i] + 60, frameNums[i] + 20, 0, 255);
        sat = constrain(sat, 0, 255);
        translate(point.x, point.y);
        texture(envImage);
        // specularMaterial(255);
        rotateY(PI * 0.25);
        sphere(point.r * sat / 255.0);
        pop();
      }
    }
  }
}

// A function to draw the skeletons
function drawSkeleton() {
  // Loop through all the skeletons detected
  for (let i = 0; i < poses.length; i++) {
    let hmax = 0;
    let hmin = 1000;
    let skeleton = poses[i].skeleton;
    // For every skeleton, loop through all body connections
    for (let j = 0; j < skeleton.length; j++) {
      let partA = skeleton[j][0];
      let partB = skeleton[j][1];
      stroke(255, 0, 0);
      line(partA.position.x, partA.position.y, partB.position.x, partB.position.y);
      hmin = Math.min(hmin, partA.position.y);
      hmin = Math.min(hmin, partB.position.y);
      hmax = Math.max(hmax, partA.position.y);
      hmax = Math.max(hmax, partB.position.y);
    }
    if(skeleton.length)
    line(skeleton[0][0].position.x, hmin, skeleton[0][0].position.x, hmax)
  }
}
